import React from 'react';

const Navbar = ({ isMenuOpen, setIsMenuOpen }) => {
  return (
    <nav className="bg-white shadow-md fixed top-0 w-full z-50">
      <div className="container mx-auto px-4 py-3 flex items-center justify-between">
        <div className="flex items-center">
          <h1 className="text-2xl font-bold text-indigo-600">Sameer Distributor</h1>
        </div>
        
        <div className="hidden md:flex space-x-8">
          <a href="#home" className="text-gray-800 hover:text-indigo-600 transition">Home</a>
          <a href="#about" className="text-gray-800 hover:text-indigo-600 transition">About</a>
          <a href="#brands" className="text-gray-800 hover:text-indigo-600 transition">Brands</a>
          <a href="#products" className="text-gray-800 hover:text-indigo-600 transition">Products</a>
          <a href="#contact" className="text-gray-800 hover:text-indigo-600 transition">Contact</a>
        </div>
        
        <div className="md:hidden">
          <button onClick={() => setIsMenuOpen(!isMenuOpen)} className="text-gray-800 focus:outline-none">
            <svg className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor">
              {isMenuOpen ? (
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M6 18L18 6M6 6l12 12" />
              ) : (
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 6h16M4 12h16M4 18h16" />
              )}
            </svg>
          </button>
        </div>
      </div>
      
      {/* Mobile Menu */}
      {isMenuOpen && (
        <div className="md:hidden bg-white shadow-lg py-2">
          <a href="#home" className="block px-4 py-2 text-gray-800 hover:bg-indigo-100">Home</a>
          <a href="#about" className="block px-4 py-2 text-gray-800 hover:bg-indigo-100">About</a>
          <a href="#brands" className="block px-4 py-2 text-gray-800 hover:bg-indigo-100">Brands</a>
          <a href="#products" className="block px-4 py-2 text-gray-800 hover:bg-indigo-100">Products</a>
          <a href="#contact" className="block px-4 py-2 text-gray-800 hover:bg-indigo-100">Contact</a>
        </div>
      )}
    </nav>
  );
};

export default Navbar;
